import React from "react"
import { Route } from "react-router-dom"

function userIsLoggedIn(){
    return false
}

export default function AppRouter({
    component: Component,
    path,
    isPrivate,
    ... props
}){
    return(
        <Route
            path={path}
            render={props =>{
                isPrivate && !userIsLoggedIn() ? (<div>user not login</div>
                ) : (
                    <Component {... props} />
                )
            }}
            {... props}
        />
    )
}
